// src/components/ViewersList.js
import React from 'react';
import '../../CSS/ViewersList.css'; 


const ViewersList = ({ viewers, onBack }) => (
  <div className="viewers-list">
    <h2>Viewers List</h2>
    {viewers.length === 0 ? (
      <p>No viewers found.</p>
    ) : (
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
          </tr>
        </thead>
        <tbody>
          {viewers.map((viewer) => (
            <tr key={viewer.id}>
              <td>{viewer.id}</td>
              <td>{viewer.firstName}</td>
              <td>{viewer.lastName}</td>
            </tr>
          ))}
        </tbody>
      </table>
    )}
    <button onClick={onBack}>Back to Admin Options</button>
  </div>
);

export default ViewersList;
